Birmania An Birmania o Myanmar (Binirmano: [mjəmà]) nga an buhatonon nga pagtawag Republika han Paghiusa han Myanmar ngan kilalado gihapon nga Burma, usa nga nasod ha Timugan nga Asya. Ginsasapitan an Birmania han India ngan Bangladesh ha katundan, Thailand ngan Laos ha sinirangan ngan han Tsina ha amihan ngan ha dumagsaan. Ha salatan, mga hin ka-tulo nga bahin han bug-os nga perimeter han Birmania hin 5,876 km (3,651 mi) naghihimo hin durudiritso nga labnasan hin 1,930 km (1,200 mi) ha Bay han 
..........
e kilometres (261,228 square miles) hin kadako. An pamunoan nga syudad hini Naypyidaw, ngan an gidako-i nga syudad ngan kasanhi nga pamunoan Yangon (Rangoon).[3] An Birmania api han Association of Southeast Asian Nations (ASEAN) tikang han 1997. Mga kasarigan[igliwat | Igliwat an wikitext] - ↑ "Asian Development Bank and Myanmar: Fact Sheet". Asian Development Bank. 30 Abril 2012. Ginhipos tikang ha an orihinal han 26 Nobyembre 2011. Ginkuhà 20 Nobyembre 2012. - ↑ Ipakita an sayop: Invalid tag;
